// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./math.sol";

contract TestMath {
    using Math for uint;
    function TestAdd() public pure returns(uint){
        uint a = 1;
        return a.add(2);
    }
    function TestMinus() public pure returns(uint){
        uint a = 10;
        return a.minus(2);
    }
    function TestMultiple() public pure returns(uint){
        uint a = 10;
        return a.multiple(2);
    }
    function TestDivide() public pure returns(uint){
        uint a = 10;
        return a.divide(2);
    }    
}

chapter05/math.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library Math {
    // 0.8.0 后可以有状态变量，但是不能被访问
    function add(uint _x, uint _y) public pure returns(uint){
        return _x+_y;
    }
    function minus(uint _x, uint _y) public pure returns(uint){
        return _x-_y;
    }
    function multiple(uint _x, uint _y) public pure returns(uint){
        return _x * _y;
    }
    function divide(uint _x, uint _y) public pure returns(uint){
        return _x / _y;
    }    
}

